import React from 'react';
import './TeamComparisonCard.css';

// TeamComparisonCard component
const TeamComparisonCard = ({ team1, team2 }) => {
    // Return JSX
  return (
    // Team comparison card
// Compare this snippet from football-stats/src/components/TeamComparisonCard.js:
    <div className="team-comparison-card">
        // Team 1
      <div className="team team-left">
        <h2>{team1.name}</h2>
        <p>Wins: {team1.wins}</p>
        <p>Losses: {team1.losses}</p>
        <p>Draws: {team1.draws}</p>
        <p>Points: {team1.points}</p>
      </div>
      
      <div className="vs-divider">VS</div>
      
      // Team 2
      <div className="team team-right">
        <h2>{team2.name}</h2>
        <p>Wins: {team2.wins}</p>
        <p>Losses: {team2.losses}</p>
        <p>Draws: {team2.draws}</p>
        <p>Points: {team2.points}</p>
      </div>
    </div>
  );
};

export default TeamComparisonCard;
